import React from 'react';
import './examples.css';

const Examples = () => {
    return(
        <section className='examples'>
            <h4>Examples</h4>
            <ul className='examples__list'>
                <li>
                    1
                </li>
                <li>
                    2
                </li>
                <li>
                    3
                </li>
                <li>
                    4
                </li>
                <li>
                    5
                </li>
            </ul>
        </section>
    );
};

export default Examples;
